// src/components/Register.js
import React, { useState } from "react";
import axios from "axios";
import { useNavigate, Link } from "react-router-dom";
import {
  Container,
  Typography,
  TextField,
  Button,
  Box,
  Alert,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  Checkbox,
  FormControlLabel,
} from "@mui/material";

const Register = () => {
  const [formData, setFormData] = useState({
    firstName: "",
    lastName: "",
    email: "",
    password: "",
    confirmPassword: "",
    birthDay: "",
    birthMonth: "",
    birthYear: "",
    agreeTerms: false,
  });
  const [error, setError] = useState("");
  const [success, setSuccess] = useState("");
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value, checked, type } = e.target;
    setFormData({
      ...formData,
      [name]: type === "checkbox" ? checked : value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (formData.password !== formData.confirmPassword) {
      setError("As senhas não coincidem.");
      return;
    }
    if (!formData.agreeTerms) {
      setError("Você deve concordar com os termos e políticas.");
      return;
    }

    setLoading(true);
    setError("");
    setSuccess("");

    try {
      const payload = {
        username: formData.email, // Usar o email como username
        email: formData.email,
        password: formData.password,
        first_name: formData.firstName,
        last_name: formData.lastName,
        birth_date: `${formData.birthYear}-${formData.birthMonth}-${formData.birthDay}`,
      };
      console.log("Dados enviados:", payload); // Adicione este log

      const response = await axios.post("http://localhost:8000/api/register/", payload);
      console.log("Resposta do backend:", response.data);
      setSuccess("Registro realizado com sucesso! Redirecionando para o login...");
      setTimeout(() => {
        navigate("/login");
      }, 2000);
    } catch (err) {
      console.error("Erro ao registrar:", err.response?.data); // Adicione este log
      setError(err.response?.data?.message || "Erro ao registrar usuário.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <Container maxWidth="sm">
      {/* Cabeçalho */}
      <Typography
        variant="h2"
        component="h1"
        align="center"
        sx={{
          fontFamily: "Poppins, sans-serif",
          fontWeight: 600,
          mt: 4,
          mb: 2,
        }}
      >
        trinar
      </Typography>

      {/* Formulário */}
      <Box
        sx={{
          backgroundColor: "background.paper",
          borderRadius: 2,
          boxShadow: 3,
          p: 3,
          mt: 2,
        }}
      >
        <Typography variant="h5" component="h2" align="center" gutterBottom>
          Crie uma conta
        </Typography>
        <Typography variant="subtitle1" color="textSecondary" align="center">
          É rápido e fácil.
        </Typography>
        <hr style={{borderColor: '#FFF', borderWidth: '1px', margin: '5'}}/>

        {/* Mensagens de erro e sucesso */}
        {error && <Alert severity="error" sx={{ mt: 2 }}>{error}</Alert>}
        {success && <Alert severity="success" sx={{ mt: 2 }}>{success}</Alert>}

        {/* Campos do Formulário */}
        <Box component="form" onSubmit={handleSubmit} sx={{ mt: 3 }}>
          {/* Nome e Sobrenome */}
          <Box sx={{ display: "flex", gap: 2 }}>
            <TextField
              fullWidth
              margin="normal"
              label="Nome"
              name="firstName"
              value={formData.firstName}
              onChange={handleChange}
              required
            />
            <TextField
              fullWidth
              margin="normal"
              label="Sobrenome"
              name="lastName"
              value={formData.lastName}
              onChange={handleChange}
              required
            />
          </Box>

          {/* Email */}
          <TextField
            fullWidth
            margin="normal"
            label="Email"
            type="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            required
          />

          {/* Senha e Confirmar Senha */}
          <TextField
            fullWidth
            margin="normal"
            label="Senha"
            type="password"
            name="password"
            value={formData.password}
            onChange={handleChange}
            required
          />
          <TextField
            fullWidth
            margin="normal"
            label="Confirmar Senha"
            type="password"
            name="confirmPassword"
            value={formData.confirmPassword}
            onChange={handleChange}
            required
          />

          {/* Data de Nascimento */}
          <Typography variant="subtitle2" sx={{ mt: 2, mb: 1 }}>
            Data de Nascimento
          </Typography>
          <Box sx={{ display: "flex", gap: 2 }}>
            <TextField
              fullWidth
              margin="normal"
              label="Dia"
              name="birthDay"
              value={formData.birthDay}
              onChange={handleChange}
              type="number"
              inputProps={{ min: 1, max: 31 }}
              required
            />
            <FormControl fullWidth margin="normal">
              <InputLabel>Mês</InputLabel>
              <Select
                name="birthMonth"
                value={formData.birthMonth}
                onChange={handleChange}
                label="Mês"
                required
              >
                <MenuItem value="01">Janeiro</MenuItem>
                <MenuItem value="02">Fevereiro</MenuItem>
                <MenuItem value="03">Março</MenuItem>
                <MenuItem value="04">Abril</MenuItem>
                <MenuItem value="05">Maio</MenuItem>
                <MenuItem value="06">Junho</MenuItem>
                <MenuItem value="07">Julho</MenuItem>
                <MenuItem value="08">Agosto</MenuItem>
                <MenuItem value="09">Setembro</MenuItem>
                <MenuItem value="10">Outubro</MenuItem>
                <MenuItem value="11">Novembro</MenuItem>
                <MenuItem value="12">Dezembro</MenuItem>
              </Select>
            </FormControl>
            <TextField
              fullWidth
              margin="normal"
              label="Ano"
              name="birthYear"
              value={formData.birthYear}
              onChange={handleChange}
              type="number"
              inputProps={{ min: 1800, max: new Date().getFullYear() }}
              required
            />
          </Box>

          {/* Termos e Políticas */}
          <FormControlLabel
            control={
              <Checkbox
                name="agreeTerms"
                checked={formData.agreeTerms}
                onChange={handleChange}
                required
              />
            }
            label={
              <Typography variant="body2">
                Eu concordo com os{" "}
                <Link to="/terms" style={{ textDecoration: "none", color: "primary.main" }}>
                  Termos de Serviço
                </Link>
                ,{" "}
